import {swAPI} from "../api/api";

const GET_ROOT_RESOURSE='GET_ROOT_RESOURSE'

let initialState={
    rootResourse: {}
}

const statisticReducer=(state=initialState,action)=>{
    switch (action.type){
        case GET_ROOT_RESOURSE:
            return {
                ...state
            }
        default:
            return state

    }
}

const getRootResourseAC=()=>({type:GET_ROOT_RESOURSE})



export default statisticReducer;
